import React,{useState,useEffect} from 'react'
import './style.css'
import axios from 'axios'

export default function Alldata() {

  const [user,setUser]=useState('');
  console.log(user)
  const getData=()=>{
    axios.get("http://localhost:8001/Data")
    .then((response)=>{
      const allUser=response.data;
      setUser(allUser);
     
    })
    .catch(error => console.log(error))
  }

  useEffect(()=>{
    getData();
  },[])

  return (
   <section className="bg-primary">
     <div className="container pb-5">
            <h3 className="text-center pt-5 text-white pb-5">All Information</h3>
            <table className="table text-white table-bordered border-white w-75 mx-auto">
        <thead>
          <tr>
            <th scope="col">Id</th>
            <th scope="col">Name</th>
            <th scope="col">User Name</th>
            <th scope="col">Email</th>
            <th scope="col">Action</th>
          </tr>
        </thead>
        <tbody>
          {user.map((val)=>{
            return(
              <tr>
                <td>{val.id}</td>
                <td>{val.name}</td>
                <td>{val.username}</td>
                <td>{val.email}</td>
                <td>
                  <button>Edit</button>
                  <button>Delete</button>
                  <button className="m">View</button>
                </td>
              </tr>
            )
          })}
          
         
    
                
    
        </tbody>
      </table>
     </div>
   </section>
  )
}
